response.about:
Рады приветствовать Вас в нашем интернет магазине автозапчастей PINAZA.RU.

PINAZA.RU предлагает Вам:

выбор из 3 тысяч торговых марок и более чем 30 миллионов наименований запасных частей; 
разумные цены и высокое качество поставляемых деталей;

подбор запасных частей по оригинальному номеру производителя или по названию детали;
ежедневное обновление наличия оригинальных и неоригиналных автозапчастей на центральных складах автопроизводителей и складах крупных поставщиков автомобильных деталей;
в нашей базе используются номера запасных частей, строго совпадающие с номерами и артикулами, используемыми производителями автомобилей и автозапчастей, а также официальными дилерами для точной идентификации деталей;

скидки постоянным и оптовым клиентам;
доставку по городу, отправку в область, отправку в регионы;

а кроме того: внимание и индивидуальный подход к каждому клиенту; ответственность за сроки поставки запчастей и соответствие деталей Вашему автомобилю.
